import React from 'react'
import './Collection.css'
import data from '../Assets/data'
import Item from '../Item/Item'
const Collection = () => {
  return (
    <div className='collection'>
        <div className="items">
            {data.map((item,i)=>{
                return <Item image={item.image} />
            })}
        </div>
      
    </div>
  )
}

export default Collection
